import { useRouteError } from "react-router-dom";

export default function NotFound() {
  const error = useRouteError();
  console.error(error);

  return (
    <div id="error-page">
      <h1 style={{color: "white", fontFamily: "Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif'"}}>Oops!</h1>
    </div>
  );
}
